import logoLight from '../../assets/logo-light.svg';
import './style.css';
import Button from './'

const HomePage = () => {
  return (
    <main>
      <div>
        <img src={logoLight} alt="Logo NuKenzie" />
        <h1>Centralize o controle das suas finanças</h1>
        <p>de forma rápida e segura</p>
        <Button text="Iniciar" />
      </div>
      <div></div>
    </main>
  );
};

export default HomePage;
